import React from 'react';
import Data from '../data.json'
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import mark from '../components/icons/mark.png'
import L from 'leaflet';
import { Grid} from '@material-ui/core';

export default function Region() {

    let Icon = L.icon({
        iconUrl: mark,
        iconRetinaUrl: mark,
        iconAnchor: [5, 55],
        popupAnchor: [10, -44],
        iconSize: [20, 23],
    });
    const loslagos = [-41.7500000,-73.0000000]

                return (
                    <div className='propiedad'>
                        <Grid  item xs={6}>
                            <MapContainer
                                className="map"
                                center={loslagos}
                                zoom={7.4}
                                style={{ height: 500, width: "100%" }}
                            >
                                <TileLayer
                                    attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                                />

                                {Data.map(post => {
                                    <Marker key={post.id} position={[ post.lat, post.long ]} icon={Icon} >
                                        <Popup>
                                            Corretajes Bulltechs.
                                        </Popup>
                                    </Marker>
                                })}
                            </MapContainer>
                        </Grid>
                        })}
                    </div>
                );

}
